--
-- Estructura para la vista `view_publicaciones`
--
DROP TABLE IF EXISTS `view_publicaciones`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_publicaciones`  AS SELECT `publicacion`.`nroPublicacion` AS `nroPublicacion`, `publicacion`.`fechaPublicacion` AS `fechaPublicacion`, `publicacion`.`titulo` AS `titulo`, `publicacion`.`descripcion` AS `descripcion`, `publicacion`.`precio` AS `precio`, `descuento`.`porcentaje` AS `porcentaje`, round(`publicacion`.`precio` - `publicacion`.`precio` * `descuento`.`porcentaje` / 100,0) AS `descuento`, `productos`.`idProducto` AS `idProducto`, `productos`.`categoria` AS `categoria`, `productos`.`genero` AS `genero`, `productos`.`material` AS `material`, `productos`.`marca` AS `marca`, `cuenta_empresa`.`email` AS `emailVendedor`, `cuenta_empresa`.`nombre` AS `nombreVendedor`, `fotos`.`imagen` AS `imagen` FROM ((((`publicacion` join `productos` on(`publicacion`.`producto` = `productos`.`idProducto`)) left join `descuento` on(`descuento`.`publication` = `publicacion`.`nroPublicacion`)) join `cuenta_empresa` on(`cuenta_empresa`.`email` = `publicacion`.`vendedor`)) left join `fotos` on(`fotos`.`publicacion` = `publicacion`.`nroPublicacion`)) GROUP BY `publicacion`.`nroPublicacion` ;

